const IndexPage = ({ data }) => {
  const { frontmatter } = data.markdownRemark
  return (
    <Fragment>
      <Layout>
        <Helmet>
          <meta charSet="utf-8" />
          <title>{Strings.hometitle}</title>
          <meta name="description" content={Strings.homedescription} />
        </Helmet>
        <IndexPageTemplate
          homebanner={frontmatter.homebanner}
          stranetwoblocks={frontmatter.stranetwoblocks}
          threetab={frontmatter.threetab}
        />
      </Layout>
    </Fragment>
  )
}

IndexPage.propTypes = {
  data: PropTypes.shape({
    markdownRemark: PropTypes.shape({
      frontmatter: PropTypes.object,
    }),
  }),
}

export default IndexPage

